import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles((theme) => ({
  gridApresentacao: {
    background: "#fac710",
    height: "100vh",
    display: "flex",
    alignItems: "center",
    flexDirection: "row",
  },
  root: {
    height: "100vh",
  },
}));
